import { prop, getModelForClass } from "@typegoose/typegoose"
import { Field, ObjectType, InputType, ID, Int } from "type-graphql";
import {PushSubscription} from './Landlord'
import {APIResult} from "."
import {Property} from './Property'
import {ObjectId} from 'mongodb'

/**
 * SearchStatus
 * @desc describes the status of whether a student
 * is looking for a property or not. And if so, for
 * which time period.
 */
@ObjectType({description: "Status of student search"})
export class SearchStatus {

  // @prop -> date_updated: The ISO string of the last date the status was updated
  @Field(type => String)
  @prop({type: String})
  date_updated: string;

  // @prop -> searching: If true, the student is searching for a propety
  @Field(type => Boolean)
  @prop({type: Boolean})
  searching: boolean;

  // prop -> search_start: The start date the student is searching for, if searching is true
  @Field(type => String, {nullable: true})
  @prop({type: String})
  search_start?: string;

  // prop -> search_end: The end date the student is searching for, if searching is true
  @Field(type => String, {nullable: true})
  @prop({type: String})
  search_end?: string;

  // prop -> price_start: The start price for lease
  @Field(type => Number, {nullable: true})
  @prop({type: Number})
  price_start?: number;

  // prop -> price_end: The end price for lease
  @Field(type => Number, {nullable: true})
  @prop({type: Number})
  price_end?: number;
}
/** 
 * Modify the student object to provide default values
 * for the student's search status properties.
*/
export const initializeStudentSearchStatus = (student: Student) => {
  student.search_status = new SearchStatus();
  student.search_status.date_updated = new Date(0).toISOString();
  student.search_status.searching = false;
}

/**
 * StudentUserSettings
 * @desc describes the settings object for a student
 */
@ObjectType({description: "Student User Settinhs"})
export class StudentUserSettings {
  @Field(type => Boolean)
  @prop({type: Boolean})
  recieve_email_notifications: boolean;

  @Field(type => [PushSubscription])
  @prop({type: [PushSubscription]})
  push_subscriptions: PushSubscription[];
}

export const initializeStudentSettings = (student: Student) => {
  if (student.user_settings) return;
  student.user_settings = new StudentUserSettings();
  student.user_settings = {
    recieve_email_notifications: true,
    push_subscriptions: []
  }
}

/**
 * CasAuthInfo
 * @desc describes the CAS authentication information
 * for a student logging in through CAS auth 3.0 system.
 */
@ObjectType({description: "Cas Auth Information"})
class CasAuthInfo {
  @Field(type => String, { nullable: true })
  @prop({type: String})
  cas_id: String;
  
  @Field(type => String, { nullable: true })
  @prop({type: String})
  institution_id: String;
}

@ObjectType({description: "An array of collection entries"}) 
export class PropertyCollectionEntries{  
  @Field(type => [Property])
  @prop({ type: [Property] })
  collection_entries: Partial<Property>[];
}

@ObjectType()
export class NotificationAction {

  @Field(type => String)
  @prop({type: String})
  action_text: string;

  @Field(type => String)
  @prop({type: String})
  action_url: string;
}

@ObjectType()
export class StudentNotification {

  @Field(type => String)
  @prop({type: String})
  _id: string;

  @Field(type => String)
  @prop({type: String})
  date_created: string;

  // The date that the notification was seen.
  // This is only set if the student has seen the notification
  @Field(type => String, {nullable: true})
  @prop({type: String})
  date_seen?: string;

  @Field(type => String)
  @prop({type: String})
  subject: string;

  @Field(type => String)
  @prop({type: String})
  body: string;

  @Field(type => NotificationAction, {nullable: true})
  @prop({type: NotificationAction})
  action?: NotificationAction;

}

@ObjectType()
export class StudentNotificationCollection {

  @Field(type => [StudentNotification])
  @prop({type: [StudentNotification]})
  notifications: StudentNotification[];
}

@ObjectType()
export class StudentNotificationAPIResponse extends APIResult(StudentNotificationCollection) {}

@ObjectType()
export class AcceptedLeaseInfo {

  // The id of the lease document that was accepted
  // by the student
  @Field(type => String)
  @prop({type: String})
  lease_id: string;

  // The id of the lease history instance that the student has
  // accepted.
  @Field(type => String)
  @prop({type: String})
  history_id: string;
}

/**
 * Student
 * @desc The student object that describes a student
 * user.
 */
@ObjectType({description: "Student model"})
export class Student {
  @Field(() => ID)
  _id: string;

  @Field()
  @prop()
  first_name: String;

  @Field()
  @prop()
  last_name: String;
  
  @Field()
  @prop()
  email: String;
  
  @Field(type => String, {nullable: true})
  @prop()
  phone_number?: String;

  @Field(type => CasAuthInfo, { nullable: true })
  @prop({ type: CasAuthInfo })
  auth_info: CasAuthInfo;

  @Field(type => [String], {nullable: true})
  @prop({type: [String]})
  saved_collection: string[];

  @Field(type => String, {nullable: true})
  @prop({type: String})
  type?: String;

  @Field(type => [String], {nullable: true})
  @prop({type: String})
  elevated_privileges?: string[]

  @Field(type => [String], {nullable: true})
  @prop({type: String})
  confirmation_key?: string;

  @Field(type => StudentUserSettings, {nullable: true})
  @prop({type: StudentUserSettings})
  user_settings?: StudentUserSettings;

  @Field(type => SearchStatus, {nullable: true})
  @prop({type: SearchStatus})
  search_status?: SearchStatus;

  @Field(type => [StudentNotification], {nullable: true})
  @prop({type: [StudentNotification]})
  notifications?: StudentNotification[];

  // The array of leases the student has currently
  // accepted (either current, or in the future)
  @Field(type => [AcceptedLeaseInfo], {nullable: true})
  @prop({type: [AcceptedLeaseInfo]})
  accepted_leases: AcceptedLeaseInfo[];

  // The list of tags that a student sets as
  // conveniecne identifiers for property
  // personalization
  @Field(type => [String], {nullable: true})
  @prop({type: [String]})
  convenience_tags?: string[];

  @Field(type => Boolean, {nullable: true})
  @prop({type: Boolean})
  conveinence_setup: boolean;
}

@InputType()
export class StudentInput implements Partial<Student> {

  @Field({ nullable: true })
  _id: string;

  @Field({ nullable: true })
  first_name: String;

  @Field({ nullable: true })
  last_name: String;
  
  @Field({ nullable: true })
  email: String;
}

@InputType()
export class CollectionFetchInput {

  @Field(type => Int)
  @prop({type: Int})
  offset: number;

  @Field(type => Int)
  @prop({type: Int})
  count: number;
}

@ObjectType()
export class StudentAPIResponse extends APIResult(Student) {}
@ObjectType()
export class PropertyCollectionEntriesAPIResponse extends APIResult(PropertyCollectionEntries) {}

export const StudentModel = getModelForClass(Student)

///////////////////
@ObjectType()
class NumberValue {

  @Field(type => Number)
  @prop({type: Number})
  value: number;
}

@ObjectType()
export class NumberAPIResponse extends APIResult(NumberValue) {}

import {prop, getModelForClass} from "@typegoose/typegoose"
import {Field, ObjectType, ID, InputType} from "type-graphql"
import {APIResult} from "."

@ObjectType({description: "Keys for push subscription"})
class PushSubscriptionKeys {

  @Field(type => String)
  @prop({type: String})
  p256dh: string;

  @Field(type => String)
  @prop({type: String})
  auth: string;
}

@ObjectType({description: "Push Subscription Details"})
export class PushSubscription {
  
  @Field(type => String)
  @prop({type: String})
  endpoint: string;
  
  @Field(type => PushSubscriptionKeys)
  @prop({type: PushSubscriptionKeys})
  keys: PushSubscriptionKeys;

}

@ObjectType({description: "Landlord User Settings"})
export class LandlordUserSettings {
  @Field(type => Boolean)
  @prop({type: Boolean})
  recieve_email_notifications: boolean;

  @Field(type => [PushSubscription])
  @prop({type: [PushSubscription]})
  push_subscriptions: PushSubscription[];
}
export const initializeLandlordSettings = (student: Landlord) => {
  if (student.user_settings) return;
  student.user_settings = new LandlordUserSettings();
  student.user_settings = {
    recieve_email_notifications: true,
    push_subscriptions: []
  }
}

@ObjectType({description: "Landlord model"})
export class Landlord {
  @Field(() => ID)
  _id: string;

  @Field()
  @prop()
  first_name: string;

  @Field()
  @prop()
  last_name: string;

  @Field()
  @prop()
  email: string;

  @Field({ nullable: true })
  @prop()
  phone_number: string;

  @Field(type => String, {nullable: true})
  @prop({type: String})
  password?: string;
  
  @Field(type => String, {nullable: true})
  @prop({type: String})
  type?: String;

  @Field(type => String, {nullable: true})
  @prop({type: String})
  confirmation_key?: string;

  @Field(type => Boolean, {nullable: true})
  @prop({type: Boolean})
  onboarded?: boolean;

  @Field(type => LandlordUserSettings, {nullable: true})
  @prop({type: LandlordUserSettings})
  user_settings?: LandlordUserSettings;

  @Field(type => String, {nullable: true})
  @prop({type: String})
  landlord_reset_key?: string;

  // The expiration date for any reset link given
  @Field(type => String, {nullable: true})
  @prop({type: String})
  landlord_reset_link_exp?: string;
}

@InputType()
export class LandlordInput implements Partial<Landlord> {
  @Field({nullable: true})
  _id: string;

  @Field({nullable: true})
  first_name: string;
  
  @Field({nullable: true})
  last_name: string;
  
  @Field({nullable: true})
  email: string;
  
  @Field({nullable: true})
  phone_number: string;
  
  @Field({nullable: true})
  password: string;
}

@ObjectType()
export class LandlordAPIResponse extends APIResult(Landlord) {}

export const LandlordModel = getModelForClass(Landlord)

import {ClassType, ObjectType, Field} from "type-graphql"
import {ObjectId} from "mongodb"
import { GraphQLScalarType, Kind } from "graphql";

export function APIResult<T>(TItemClass: ClassType<T>) {

  @ObjectType({ isAbstract: true })
  abstract class APIResponseClass {

    @Field(type => Boolean)
    success: boolean;

    @Field(type => String, {nullable: true})
    error?: String;

    @Field(type => TItemClass, {nullable: true})
    data?: T | null;

  }
  return APIResponseClass
}

export type Ref<T> = T | ObjectId

export const ObjectIdScalar = new GraphQLScalarType({
  name: "ObjectId",
  description: "Mongo object id scalar type",
  serialize(value: unknown): string {
    // check the type of received value
    if (!(value instanceof ObjectId)) {
      throw new Error("ObjectIdScalar can only serialize ObjectId values");
    }
    return value.toHexString(); // value sent to the client
  },
  parseValue(value: unknown): ObjectId {
    // check the type of received value
    if (typeof value !== "string") {
      throw new Error("ObjectIdScalar can only parse string values");
    }
    return new ObjectId(value); // value from the client input variables
  },
  parseLiteral(ast): ObjectId {
    // check the type of received value
    if (ast.kind !== Kind.STRING) {
      throw new Error("ObjectIdScalar can only parse string values");
    }
    return new ObjectId(ast.value); // value from the client query
  },
});

import {prop, DocumentType, getModelForClass, Ref} from "@typegoose/typegoose"
import { type } from "os";
import {Field, ObjectType, ID, InputType, Int, Float} from "type-graphql"
import {Lease} from './Lease'
import {APIResult} from "."

import {Landlord} from './Landlord'

@ObjectType({description: "The directions coordinates information"})
export class DirectionCoordinates {

  @Field(type => Number)
  @prop({type: Number})
  distance: number;

  @Field(type => [[Number]])
  @prop({type: [[Number]]})
  coordinates: Number[][];
}

@ObjectType({description: "Property directions to an institution"})
export class PropertyDirections {

  /**
   * The id of the institution that this directions object
   * leads to, from the parent property location
   */
  @Field(() => String)
  @prop({type: String})
  institution_id: string;

  @Field(() => [DirectionCoordinates], {nullable: true})
  @prop({type: [DirectionCoordinates]})
  foot_walking_directions?: DirectionCoordinates[];

  @Field(() => [DirectionCoordinates], {nullable: true})
  @prop({type: [DirectionCoordinates]})
  driving_car_directions?: DirectionCoordinates[];

  @Field(() => [DirectionCoordinates], {nullable: true})
  @prop({type: [DirectionCoordinates]})
  cycling_regular_directions?: DirectionCoordinates[];

}

@ObjectType({description: "Property Image info"})
export class PropertyImageInfo {
  @Field(type => String)
  @prop({type: String})
  s3_key: string;

  @Field(type => String)
  @prop({type: String})
  date_uploaded: string;
}

@ObjectType({description: "Details describing the property"})
export class PropertyDetails {

  @Field(type => String)
  @prop({type: String})
  description: string;

  @Field(type => Int)
  @prop()
  rooms: number;

  @Field(type => Int)
  @prop()
  bathrooms: number;

  @Field(type => Float)
  @prop()
  sq_ft: number;

  @Field(type => Boolean)
  @prop({type: Boolean})
  furnished: boolean;

  @Field(type => Boolean)
  @prop({type: Boolean})
  has_washer: boolean;

  @Field(type => Boolean)
  @prop({type: Boolean})
  has_heater: boolean;
  
  @Field(type => Boolean)
  @prop({type: Boolean})
  has_ac: boolean;

  @Field(type => [PropertyImageInfo])
  @prop({type: [PropertyImageInfo]})
  property_images: PropertyImageInfo[];
}

@ObjectType({description: "Property model"})
export class Property {
  @Field(() => ID)
  _id: string;

  @Field()
  @prop()
  landlord: string;

  @Field({nullable: true})
  @prop()
  landlord_doc?: Landlord;

  @Field(type => String)
  @prop({type: String})
  address_line: string;
  
  @Field(type => String, {nullable: true})
  @prop({type: String})
  address_line_2?: string;
  
  @Field(type => String)
  @prop({type: String})
  city: string;

  @Field(type => String)
  @prop({type: String})
  state: string;
  
  @Field(type => String)
  @prop({type: String})
  zip: string;

  @Field(type => PropertyDetails, {nullable: true})
  @prop({type: PropertyDetails})
  details?: PropertyDetails;

  @Field(type => [PropertyDirections], {nullable: true})
  @prop({type: [PropertyDirections]})
  directions?: PropertyDirections[];

  @Field(type => [Lease], {nullable: true})
  leases?: Lease[];
}

export const getAddress = (property: DocumentType<Property>): string => {
  let addr: string = `${property.address_line}, `;
  if (property.address_line_2) {
    addr += `${property.address_line_2}, `;
  }
  addr += `${property.city} ${property.state}, ${property.zip}`;
  return addr;
  //return `${property_.address_line}, ${property_.address_line_2 == "" ? '' : `${property_.address_line_2}, ${property_.city} ${property_.state}, ${property_.zip}`}`
}

@InputType()
export class PropertyReviewInput {

  @Field(type => Boolean,{nullable: false})
  @prop({type: Boolean})
  withReviews: boolean;

  @Field(type => Int, {nullable: true})
  @prop({type: Int})
  offset: number;

  @Field(type => Int, {nullable: true})
  @prop({type: Int})
  count: number;
}

@InputType()
export class PropertySearchInput {

  @Field(type => Int, {nullable: true})
  @prop({type: Int})
  offset: number;

  @Field(type => Int, {nullable: true})
  @prop({type: Int})
  count: number;
}

@ObjectType({description: "Collection of properties"})
export class PropertyList {
  @Field(type => [Property])
  @prop({type: [Property]})
  properties: Property[]
}

@ObjectType()
export class PropertySearchResult {

  @Field(type => Property)
  property: Property; //

  @Field(type => String)
  landlord_first_name: string; //

  @Field(type => String)
  landlord_last_name: string; //

  @Field(type => [Float])
  price_range: number[]; //

