        if (!ObjectId.isValid(student_id)) return { v: '0' };
        // make sure their info is not already instiantiated
        let new_student_info: DocumentType<StudentStats> | null = await StudentStatsModel.findOne({
            stat_collection_id: StatsCollectionIDs.USER_STATS,
            student_id,
            user_type: 'student'
        });

        if (new_student_info != null) return { v: '0' };

        // get the institution their account is associated with
        let student_: DocumentType<Student> | null = await StudentModel.findById(student_id);
        if (student_ == null) return { v: '0' };

        let institution: DocumentType<Institution> | null = await InstitutionModel.findById(
            student_.auth_info.institution_id
        );
        if (institution == null) return { v: '0' };

        let creation_info = new StudentAccountCreationStats();
        creation_info.date_time = new Date().toISOString();
        creation_info.institution = institution.name;

        new_student_info = new StudentStatsModel();
        new_student_info.stat_collection_id = StatsCollectionIDs.USER_STATS;
        new_student_info.student_id = student_id;
        new_student_info.user_type = 'student';
        new_student_info.creation = creation_info;

        new_student_info.save();

        return {v: STATS_API_VERSION};

    }

    /**
     * @desc Log the times a student logs into the application
     * @param student_id The id of the student logging in
     */
    @Mutation(() => StatsResponse)
    async Stats_StudentLogin (
        @Ctx() context: any
    ): Promise<StatsResponse>
    {

        let student_id = context.req.user._id;
        if (!ObjectId.isValid(student_id)) return {v: '0'};
        
        let student_stats: DocumentType<StudentStats> | null = await StudentStatsModel.findOne({
            stat_collection_id: StatsCollectionIDs.USER_STATS,
            student_id,
            user_type: 'student'
        });

        // if the stats for the user do not exist, create the new document
        if (student_stats == null) {
            return {v: '0'}
        }

        // add today to the list of dates logged in to the application
        if (student_stats.login_dates_and_times == null) {
            student_stats.login_dates_and_times = [];
        }

        let new_login_info = new LoginDateTime();
        new_login_info.date_time = new Date().toISOString();
        new_login_info.device_type = 'desktop';
        new_login_info.user_agent = 'placeholder';

        student_stats.login_dates_and_times.push(new_login_info);
        student_stats.save();

        return { v: STATS_API_VERSION }
    }

};

import { prop, getModelForClass } from "@typegoose/typegoose"
import { Field, ObjectType, InputType, ID, Int, Float } from "type-graphql"
import { Student } from './Student'
import { Property } from './Property'
import { Landlord } from './Landlord'
import { Institution } from './Institution'
import { LeaseDocument } from './LeaseDocument'
import {APIResult} from "."
import { DocumentType } from "@typegoose/typegoose"
import mongoose from 'mongoose'

export const STATS_API_VERSION = '0.0.1';

export const StatsCollectionIDs = {
    USER_STATS: 'user_statistics_coll',
    LANDLORD_STATS: 'landlord_statistics_coll'
};

export class LeaseCreationStat {

    // the property id that the lease was created for
    @Field(type => String)
    @prop({type: String})
    for_property: string;

    // the lease_if that was created
    @Field(type => String)
    @prop({type: String})
    for_lease: string;

    @Field(type => Boolean)
    @prop({type: Boolean})
    has_active_promo: boolean;

    @Field(type => String)
    @prop({type: String})
    date_time: string;
}

export class LoginDateTime {

    @Field(type => String)
    @prop({type: String})
    date_time: string;

    @Field(type => String)
    @prop({type: String})
    device_type: 'mobile' | 'desktop';

    @Field(type => String)
    @prop({type: String})
    user_agent: string;
}

export class StudentAccountCreationStats {

    @Field(type => String)
    @prop({type: String})
    date_time: string;

    @Field(type => String)
    @prop({type: String})
    institution: string;
}

export class StudentStats {

    @Field(type => String)
    @prop({type: String})
    stat_collection_id: string;

    @Field(type => String)
    _id: string;

    @Field(type => StudentAccountCreationStats)
    @prop({type: StudentAccountCreationStats})
    creation: StudentAccountCreationStats;

    @Field(type => String)
    @prop({type: String})
    user_type: 'student';

    @Field(type => String)
    @prop({type: String})
    student_id: string;

    @Field(type => [LoginDateTime], {nullable: true})
    @prop({type: [LoginDateTime]})
    login_dates_and_times?: LoginDateTime[]
}

export class LandlordStats {

    @Field(type => String)
    @prop({type: String})
    stat_collection_id: string;

    @Field(type => String)
    _id: string;

    @Field(type => String)
    @prop({type: String})
    creation: string;

    @Field(type => String)
    @prop({type: String})
    date_created: string;

    @Field(type => String)
    @prop({type: String})
    user_type: 'landlord';

    @Field(type => String)
    @prop({type: String})
    landlord_id: string;

    @Field(type => [LoginDateTime], {nullable: true})
    @prop({type: [LoginDateTime]})
    login_dates_and_times?: LoginDateTime[];

    @Field(type => [LeaseCreationStat], {nullable: true})
    @prop({type: [LeaseCreationStat]})
    lease_creations: LeaseCreationStat[];
}

export const StudentStatsModel = getModelForClass(StudentStats, {
    schemaOptions: { collection: 'statistics' }
})

export const LandlordStatsModel = getModelForClass(LandlordStats, {
    schemaOptions: { collection: 'statistics' }
})

import {Resolver, Ctx, Mutation, Arg, ObjectType, Field} from 'type-graphql';
import {StatsCollectionIDs, StudentStats, StudentStatsModel,
    LandlordStats, LandlordStatsModel, LoginDateTime, LeaseCreationStat,
    STATS_API_VERSION} from '../entities/Statistics'
import {Landlord, LandlordModel} from '../entities/Landlord'
import {DocumentType} from "@typegoose/typegoose"
import mongoose from 'mongoose'
import {hasPromo} from '../entities/Lease'
import {StatsResponse} from './StudentStatisticsResolver'
const ObjectId = mongoose.Types.ObjectId

@Resolver()
export class LandlordStatisticsResolver {

    @Mutation(() => StatsResponse)
    async Stats_LandlordAccountCreation (
        @Ctx() context: any
    ): Promise<StatsResponse>
    {

        let landlord_id = context.req.user._id;
        if (!ObjectId.isValid(landlord_id)) return {v: '0'};

        // make sure the landlord exists
        let landlord: DocumentType<Landlord> | null = await LandlordModel.findById(landlord_id);
        if (landlord == null) return {v: '0'};
        
        // make sure there isn't already a document stats object for this user
        let landlord_stats: DocumentType<LandlordStats> | null = await LandlordStatsModel.findOne({
            stat_collection_id: StatsCollectionIDs.LANDLORD_STATS,
            landlord_id,
            user_type: 'landlord'
        });
        if (landlord_stats != null) return {v: '0'};

        // create the new landlord stats object
        landlord_stats = new LandlordStatsModel();
        
        landlord_stats.landlord_id = landlord_id;
        landlord_stats.user_type = 'landlord';
        landlord_stats.stat_collection_id = StatsCollectionIDs.LANDLORD_STATS;
        landlord_stats.creation = new Date().toISOString();

        landlord_stats.save();
        return { v: STATS_API_VERSION }
        
    }

    @Mutation(() => StatsResponse)
    async Stats_LandlordLogin (
        @Ctx() context: any
    ): Promise<StatsResponse>
    {
        
        let landlord_id = context.req.user._id;
        let landlord_stats: DocumentType<LandlordStats> | null = await LandlordStatsModel.findOne({
            stat_collection_id: StatsCollectionIDs.LANDLORD_STATS,
            landlord_id,
            user_type: 'landlord'
        });

        // if the stats for the user do not exist, create the new document
        if (landlord_stats == null) {
            return {v: '0'}
        }

        // add today to the list of dates logged in to the application
        if (landlord_stats.login_dates_and_times == null) {
            landlord_stats.login_dates_and_times = [];
        }

        let new_login_info = new LoginDateTime();
        new_login_info.date_time = new Date().toISOString();
        new_login_info.device_type = 'desktop';
        new_login_info.user_agent = 'placeholder';

        landlord_stats.login_dates_and_times.push(new_login_info);
        landlord_stats.save();

        return { v: STATS_API_VERSION }
    }

    /**
     * @desc Keep track of the leases that are opened, and
     * at what times.
     */
    @Mutation(() => StatsResponse)
    async Stats_LandlordOpenLease (
        @Arg("property_id") property_id: string,
        @Arg("lease_id") lease_id: string,
        @Ctx() context: any
    ): Promise<StatsResponse>
    {

        let landlord_id = context.req.user._id;
        if (!ObjectId.isValid(landlord_id) || !ObjectId.isValid(property_id)
        || !ObjectId.isValid(lease_id))
            return { v: '0' };

        // get the stats for the landlord
        let landlord_stats: DocumentType<LandlordStats> | null = await LandlordStatsModel.findOne({
            stat_collection_id: StatsCollectionIDs.LANDLORD_STATS,
            landlord_id,
            user_type: 'landlord'
        });
        if (!landlord_stats) return { v: '0' }

        if (landlord_stats.lease_creations == null)
            landlord_stats.lease_creations = [];

        // check the lease document to see whether there is an active promo.
        let has_promo = await hasPromo(lease_id);
        // if we get null, then the lease does not exist
        if (has_promo == null) return { v: '0' }

        let stats_ = new LeaseCreationStat();
        stats_.for_property = property_id;
        stats_.for_lease = lease_id;
        stats_.has_active_promo = has_promo;
        stats_.date_time = new Date().toISOString();

        // add the stat to the document
        landlord_stats.lease_creations.push(stats_);
        landlord_stats.save();

        return { v: STATS_API_VERSION }

    }

};
